import React from "react";
import { Route, Routes, useNavigate } from "react-router-dom";
import EneryReaturants from "./EneryReaturants";
import Home from "./Home";
import Login from "./Login";
import { contextname } from "./MyContext";
import ResponsiveAppBar from "./Nacbar";
import Reaturants from "./Reaturants";
import Signup from "./Signup";

function App() {
  let navigate = useNavigate();
  const [login, setLogin] = React.useContext(contextname);
  const [username, setUsername] = React.useState("");
  const [pass, setPass] = React.useState("");
  const [conpass, setConPass] = React.useState("");
  const [usertemp, setUserTemp, pastemp, setPastemp] =
    React.useContext(contextname);

  // React.useEffect(()=>{
  //   setUserTemp(username);
  // },[pass])
  const signupbtns = () => {
    if (username == "" || pass == "" || conpass == "") {
      alert("All fields are mandetory");
    } else {
      if (pass === conpass) {
        alert("U r registered successfully" + usertemp);
        setUserTemp(username);
        setPastemp(pass);
        navigate("/");
      } else {
        alert("Passwords are not same!!!");
      }
    }
  };
  return (
    <div className="App">
      {login == 1 && <ResponsiveAppBar />}
      <Routes>
        <Route
          path="/"
          element={
            <Login
              // userval={a}
              passval={a}
              conpassval={a}
              signupbtn={signupbtns}
            />
          }
        />
        <Route path="/signup" element={<Signup />} />
        <Route path="/home" element={<Home />} />
        <Route path="/restuarents" element={<Reaturants />} />
        <Route path="/details" element={<EneryReaturants />} />
      </Routes>
    </div>
  );
}

export default App;
